text:
glenn close par platon. l'hiver des récompenses, à hollywood, c’est la saison des larmes. tout lauréat verse la sienne. on se croyait blasés. et pourtant, le 6 janvier, glenn close aurait ému un caillou. en recevant un golden globe pour sa prestation dans the wife, de björn runge, la comédienne de 71 ans a même réussi à faire pleurer ses concurrentes, de lady ­gaga à nicole kidman. « nous devrions toutes être ici, sur scène », leur a-t-elle lancé. toutes les actrices, et toutes les femmes. dans son bref discours, qui depuis tourne en boucle dans le monde entier, elle les a soudain rassemblées. honorées. ses cadettes qui luttent pour leurs droits, dans une ­industrie dominée par les hommes, mais aussi sa propre mère qui s’est « sublimée toute sa vie »pour son mari. et même cette épouse d’écrivain qu’elle vient d’interpréter dans the wife : ­sacrifiée volontaire, « faiseuse de roi », comme il est dit dans le film. nombreuses sont celles qui, de podiums en micros, ont partagé cette ferveur féministe dans les remous de l’ère post-#metoo.
mais ce soir-là, glenn close y a apporté son supplément d’âme. une puissance douce dans ses traits volontaires, presque durs, si familiers des écrans depuis quarante-cinq ans. les fantômes de tous ses personnages, dans une carrière qui raconte, à sa ­manière, une histoire de la lutte des genres. à lire dans télérama et telerama.fr le portrait "coup de poing" de cécile mury. ©platon/trunk archive/photosenso @platon @glennclose #glennclose #thewife #thewifemovie
@thenobelprize #björnrunge #goldenglobesawards @goldenglobes @trunkarchive @cecilemury

